import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import Sdata from "./Sdata";
ReactDOM.render(
  <>
  <h1> List of Marvel Movies</h1>

    <Card
      imgsrc={Sdata[0].imgsrc}
      title={Sdata[0].title}
      mname={Sdata[0].imgsrc}
      link={Sdata[0].imgsrc}
    />
    <Card
      imgsrc="https://www.themoviedb.org/t/p/w500/rzRwTcFvttcN1ZpX2xv4j3tSdJu.jpg"
      title="A Marvel Original Movie"
      mname="Thor Ragnarok"
      link="https://www.hotstar.com/in/movies/thor-ragnarok/1660010577"
    />
    <Card
      imgsrc="https://i.pinimg.com/236x/23/24/91/2324912e2b8aa4710839b47c0db66d78.jpg"
      title="A Marvel Original Movie"
      mname="Captain Thor"
      link="https://www.hotstar.com/in/movies/avengers-endgame/1260013556"
    />
  </>,
  document.getElementById("root")
);
